var chai = require("chai");
var chaiHttp = require("chai-http");
const should = chai.should();
var _ = require("underscore");
chai.use(chaiHttp);

let path = require("path");
const Pathfinder = global.Pathfinder;
const Config = require(Pathfinder.absPathInSrcFolder(path.join("models", "meta", "config.js"))).Config;

const userUtils = require(Pathfinder.absPathInTestsFolder("utils/user/userUtils.js"));

const appUtils = require(Pathfinder.absPathInTestsFolder("utils/app/appUtils.js"));
var createUserUnit = appUtils.requireUncached(Pathfinder.absPathInTestsFolder("units/users/createUsers.Unit.js"));
const md5 = require("md5");

describe("[POST] /user_avatar", function (done)
{
    this.timeout(Config.testsTimeout);
    before(function (done)
    {
        createUserUnit.setup(function (err, results)
        {
            should.equal(err, null);
            done();
        });
    });

    const demouser1 = require(Pathfinder.absPathInTestsFolder("mockdata/users/demouser1.js"));
    const demouser2 = require(Pathfinder.absPathInTestsFolder("mockdata/users/demouser2.js"));
    const demouser3 = require(Pathfinder.absPathInTestsFolder("mockdata/users/demouser3.js"));

    let avatar = {
        newAvatar: "data:image/png;base64,"
    };

    const writeAvatar = function (res, callback)
    {
        let fs = require("fs");
        let tmp = require("tmp");
        let path = require("path");

        tmp.dir(
            {
                mode: Config.tempFilesCreationMode,
                dir: Config.tempFilesDir
            },
            function (err, tempFolderPath)
            {
                if (!err)
                {
                    let avatarFilePath = path.join(tempFolderPath, demouser1.username + "avatarOutput.png");
                    fs.writeFileSync(avatarFilePath, res.body);
                    callback(err, tempFolderPath);
                }
            });
    };

    it("[HTML] should give an unauthorized error if the current user is not authenticated", function (done)
    {
        var app = global.tests.app;
        var agent = chai.request.agent(app);

        userUtils.uploadAvatar(false, agent, avatar, function (err, res)
        {
            res.should.have.status(401);
            res.text.should.contain("You are not authorized to perform this operation. You must be signed into Dendro.");
            done();
        });
    });

    it("[HTML] should upload the avatar for demouser1 if the user is authenticated as demouser1 but should not change the avatar for demouser2", function (done)
    {
        userUtils.loginUser(demouser1.username, demouser1.password, function (err, agent)
        {
            userUtils.uploadAvatar(false, agent, avatar, function (err, res)
            {
                res.should.have.status(200);
                res.body.message.should.equal("Avatar saved successfully.");
                // checking if the avatar for demouser1 is changed
                userUtils.getAvatar(false, demouser1.username, agent, function (err, res)
                {
                    res.should.have.status(200);

                    writeAvatar(res, function (err, result)
                    {
                        let imageFromServer = res.body.toString("base64");
                        let originalData = avatar.newAvatar.replace(/^data:image\/png;base64,/, "");

                        let originalDataMD5 = md5(originalData);
                        let imageFromServerMD5 = md5(imageFromServer);
                        originalDataMD5.should.equal(imageFromServerMD5);

                        // checking if the avatar for demouser2 is not changed
                        userUtils.getAvatar(false, demouser2.username, agent, function (err, res)
                        {
                            res.should.have.status(200);
                            let imageFromServerDemouser2 = res.body.toString("base64");
                            let imageFromServerDemouser2MD5 = md5(imageFromServerDemouser2);
                            imageFromServerDemouser2MD5.should.not.equal(originalDataMD5);
                            done();
                        });
                    });
                });
            });
        });
    });

    after(function (done)
    {
        appUtils.clearAppState(function (err, data)
        {
            should.equal(err, null);
            done();
        });
    });
});
